// Contact.jsx
import React from 'react';
import '../css/contact.css';

function Contact() {
  const contacts = [
    { label: 'Email', link: 'mailto:likhithsrinivas9@gmail.com', value: '‚úâÔ∏è' },
    { label: 'Phone', link: 'tel:+19342632462', value: 'üìû' },
    { label: 'LinkedIn', link: 'https://www.linkedin.com/in/srinivas-likhith/', value: 'in' },
    { label: 'GitHub', link: 'https://github.com/srinivaslikhith', value: 'GH' },
    { label: 'Instagram', link: 'https://instagram.com/YOUR_INSTAGRAM', value: 'IG' },
  ];

  return (
    <section id="contact">
      <div className="contact-orbit-container">
        {/* Center node */}
        <div className="orbit-center">Let's Connect</div>

        {/* Orbiting nodes */}
        <div className="orbit">
          {contacts.map((item, idx) => (
            <a
              key={idx}
              href={item.link}
              target="_blank"
              rel="noopener noreferrer"
              className={`orbit-node orbit-node-${idx + 1}`}
              title={item.label}
            >
              {item.value}
            </a>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Contact;
